webpackJsonp([0xf7468f04d228],{5580:function(t,a){t.exports={data:{post:{html:'<p><a href="http://scriptingnews.userland.com/pictures/viewer$689"><img alt="amsbicycle.jpg" src="http://www.papascott.de/wordpress/wp-content/uploads/2002/05/amsbicycle.jpg" width="100" height="75" border="0" align="right" /></a>Mail to Dave Winer: I was reading <a href="http://www.scripting.com">Scripting News</a> today with Cristopher on my lap. He actually wanted me to show him <a href="http://www.airbus.com/products/t_spot_a330_340.asp">airplane pictures</a> on my laptop, but I was trying to read instead. I punched up the <a href="http://scriptingnews.userland.com/pictures/viewer$689">the best picture you ever took</a> (taken in the red light district in Amsterdam), and he immediately said "Fahrrad!" (German for bicycle). He knows what\'s really important! </p>\n<p>Reply from Dave: Hehe. Smart kid. ;-></p>',fields:{title:"Fahrrad!",date:"20 May 2002",url:"https://papascott.de/2002-05-20-fahrrad/"}}},pathContext:{slug:"/2002-05-20-fahrrad/",prev:{fields:{title:"Layoffs",date:"19 May 2002",slug:"/2002-05-19-layoffs/"}},next:{fields:{title:"Layoffs Update",date:"21 May 2002",slug:"/2002-05-21-layoffs-update/"}}}}}});
